      SELECT ALL 31 AS col0 FROM tab0 WHERE CAST ( + 51 AS INTEGER ) * + - ( + 50 ) * col0 + + 56 + CAST ( + 79 AS INTEGER ) NOT IN ( - col0, + 57, + - 33 * - 77, - + 92 - + + col2, - - 13, - 0 * - col2 + - 16, + col0 * + - col2 );
  - name: tab0

outputs:
